          "comment": "Found new calling in Flat handicaps at about 1m4f of late on turf/AW; new trip can suit",
          "spotlight": "Has raced mostly over jumps but he's found a new calling in Flat handicaps of late, winning at Catterick (1m4f) before solid efforts on Southwell Tapeta (1m3f) and at Newbury; the extra furlong can suit; Tom Marquand up for the first time.",
