          "prev_owners": [],
          "comment": "Course win (6f) off 7lb lower last November; needs to step up on this season's efforts",
          "spotlight": "Ended 2024 in fine form, including when exploiting a lower AW mark in a 6f handicap here in November; two runs this year have been satisfactory but others look stronger for win purposes.",
          "medical": [],
          "quotes": [
            {
              "date": "2022-09-28",
              "horse": "Fantasy Master",
              "horse_id": "3092728",
              "race": "Fairfax Saddles Grassroots Series Final Sprint Handicap",
              "race_id": "820598",
              "course": "Nottingham",
              "course_id": "crs_1040",
              "distance_f": "6",
              "distance_y": "1338",
              "quote": "We gave Fantasy Master a racecourse gallop at Chelmsford to get him spot on for today and he's sluiced up. He loves it here and it's a big pot to win. Darryll Holland, trainer."
            },
            {
              "date": "2020-09-30",
              "horse": "Fantasy Master",
              "horse_id": "3092728",
              "race": "EBF Slip Anchor Maiden Stakes (Plus 10 Race)",
              "race_id": "766208",
              "course": "Nottingham",
              "course_id": "crs_1040",
              "distance_f": "5",
              "distance_y": "1108",
              "quote": "Fantasy Master has always gone well at home and we thought he was a nice horse, but he didn't show much on the AW on his first two starts. He did get a lot of the kickback last time at Southwell and we thought he'd be better on turf. I didn't think he'd win today, but thought he'd run well. He hit the line well despite hitting every undulation and soft ground will suit him better. He's entered in the sales race at Newmarket on Saturday and we'll have a crack if he makes the cut - Mick Appleby, trainer."
            }
          ],
          "stable_tour": [
            {
              "horse": "Fantasy Master",
              "horse_id": "3092728",
              "quote": "He raised a few eyebrows last season when winning his first race on turf as a juvenile at odds of 40-1. I was a little surprised to see him open at such a big price and I did have a few quid on him as he had been working very well and we thought he could go a bit. He proved that to be no fluke as he doubled up next time out in his first nursery off a mark of 76. We gave him a long break after his latest start in October and he has done particularly well during the close season, as he looks a much stronger individual now. I think he is a very exciting prospect for this year and he will be among our earlier runners on the turf. 29-03-21"
            }
          ],
