          "owner_id": "own_68232",
          "prev_trainers": [],
          "prev_owners": [],
          "comment": "1-2 here, close 2nd in this last year; won French Listed in December; solid on best form",
          "spotlight": "1-2 here, finishing a close second in the 2024 running on return from break; in fine form in midwinter, winning a Deauville Listed race then a Newcastle handicap in great style, and can be forgiven a lesser effort there since on first run since wind surgery; regular hood left off; respected.",
          "medical": [
            {
              "date": "2025-03-11",
              "type": "Wind Surgery"
            }
          ],
          "quotes": [
            {
              "date": "2024-03-29",
              "horse": "Cloud Cover",
              "horse_id": "5101983",
              "race": "BetMGM Fillies' And Mares' Championships Handicap",
              "race_id": "862367",
              "course": "Newcastle (AW)",
              "course_id": "crs_35178",
              "distance_f": "7",
              "distance_y": "1554",
              "quote": "I said to Cliff just before the race that I was dying for a jockey to give me a heart attack, to come so late I nearly have to go into A & E afterwards and he executed it perfectly with a peach of a ride. He gave Cloud Cover the best ride she's had. The hood also helped, the straight seven furlongs was more of a stamina test so it was crucial she settled. For a filly with her sort of rating you want black type and there's a mile fillies' Listed race at Kempton next Saturday, but that will probably come a bit soon - James Tate, trainer."
            },
            {
              "date": "2024-01-22",
              "horse": "Cloud Cover",
              "horse_id": "5101983",
              "race": "Unibet More Extra Place Races Fillies' Handicap",
              "race_id": "857468",
              "course": "Kempton (AW)",
              "course_id": "crs_28054",
              "distance_f": "7",
              "distance_y": "1540",
              "quote": "We went pretty steady which was my only worry, but I think Cloud Cover was just beaten by a good filly the last day. She was entitled to do what she did today and she's going the right way. James had her spot on and it was the perfect race for her. She could possibly be better in a better race. She's a good, strong-travelling filly even when they go a gallop. All she can do is keep improving - Rossa Ryan, jockey, speaking on Racing TV."
            },
            {
              "date": "2023-08-14",
              "horse": "Cloud Cover",
              "horse_id": "5101983",
              "race": "At The Races App Form Study Fillies' Handicap",
              "race_id": "846079",
              "course": "Wolverhampton (AW)",
              "course_id": "crs_13338",
              "distance_f": "7",
              "distance_y": "1576",
              "quote": "Cloud Cover is a filly we've liked for a while, but she's just taken her time to get to know what to do. She was a little bit green but fortunately she got her head down on the line. I'd be disappointed if there isn't more to come from her as she's a lengthy, scopey filly - James Tate, trainer."
            }
          ],
