          "owner": "Norman Court Stud & Susan Bunney",
          "owner_id": "own_1279076",
          "prev_trainers": [],
          "prev_owners": [],
          "comment": "Major form upgrade when Royal Ascot winner (1m) latest; different type of contest here",
          "spotlight": "Below best at Epsom in June; had won her previous start (7f) though and a subsequent win in the Kensington Palace at Royal Ascot (1m) was a healthy upgrade on anything she'd achieved before; tackles a very different type of contest here and she didn't shine on one previous AW run.",
          "medical": [],
          "quotes": [
            {
              "date": "2025-06-18",
              "horse": "Miss Information",
              "horse_id": "5162488",
              "race": "Kensington Palace Stakes (Fillies' Handicap)",
              "race_id": "896130",
              "course": "Ascot",
              "course_id": "crs_52",
              "distance_f": "8",
              "distance_y": "1760",
              "quote": "Miss Information has been a star. She had no luck at Epsom last time - she got shuffled back and didn't really enjoy herself - but fast ground is what she wants. She just about got a mile. I'm delighted - very good ride. These owners get so much enjoyment out of it, and I'm so pleased for them. They have a stud and she will make a lovely broodmare. We will try and get some black type for her at some stage - Andrew Balding, trainer.Andrew [Balding] said, sit prominently and save a bit, but I was concerned that Miss Information wouldn't save a bit if I allowed her to break, so I did my own thing. She relaxed and they raced in front of her; she doesn't get a mile, really, so it was important to save and save, and it worked out well. It's a race available to those sort of horses who are just below top level, fillies, so it is great to win here. She trained well, but at Epsom the other day she suffered interference, and I was concerned - although Andrew said she was great after the race - how she was after that event, bearing in mind it was only two weeks ago - so they did a great job getting here. I thought she might be at the upper limit of her handicap mark, but sometimes they eke out a little bit of improvement when things go absolutely perfectly, and today we got that - Oisin Murphy, jockey."
            },
            {
              "date": "2025-05-02",
              "horse": "Miss Information",
              "horse_id": "5162488",
              "race": "Betfred \"Nifty 50\" Handicap",
              "race_id": "891624",
              "course": "Newmarket",
              "course_id": "crs_988",
              "distance_f": "7",
              "distance_y": "1540",
              "quote": "Miss Information had come forward from her reappearance and toughed it out well. She could be a Victoria Cup type - Andrew Balding, trainer."
            },
            {
              "date": "2023-09-08",
              "horse": "Miss Information",
              "horse_id": "5162488",
              "race": "Events At Ascot Christmas Parties British EBF Restricted Novice Stakes (Bands A/B/C/D) (Qual') (GBB)",
              "race_id": "846819",
              "course": "Ascot",
              "course_id": "crs_52",
              "distance_f": "6",
              "distance_y": "1320",
              "quote": "Miss Information ran good races on her last two starts and we thought this stiffer track might suit her. She's done that really nicely and she's got a smashing temperament. She's not the biggest, but has a big heart and a really good way of galloping. I'll speak to owners about plans, but she could run again this season - Andrew Balding, trainer."
            }
          ],
