          "comment": "Responded well to the fitting of tongue-tie at Ripon; may remain competitive",
          "spotlight": "Dual AW scorer; responded well to the fitting of tongue-tie at Ripon (1m4f, good) most recently, registering a first success on turf; may well remain competitive, having gone back up just 2lb.",
          "medical": [],
          "quotes": [
            {
              "date": "2025-06-19",
              "horse": "Yakhabar",
              "horse_id": "3695497",
              "race": "Glendale Agricultural Chemicals Ladies Derby Handicap (Female Amateurs) (Special Rider Conditions)",
              "race_id": "896168",
              "course": "Ripon",
              "course_id": "crs_1274",
              "distance_f": "12",
              "distance_y": "2650",
              "quote": "It was a little bit unexpected. Yakhabar looked comfortable all the way round, he's usually a bit slow out the stalls but he jumped out sharp ? he must like Amy [Collier, jockey]. The first-time tongue-tie might have helped him and the way the race worked out suited him. He shows enough that he should be winning races like this. I wasn't going there thinking we're going to have a winner. I thought he'd have won on the all-weather in the winter but he didn't. He's not been running badly, there are a lot of placed efforts, he just hasn't been able to get his head in front, but he put that right - Liam Bailey, trainer."
            },
            {
              "date": "2024-04-08",
              "horse": "Yakhabar",
              "horse_id": "3695497",
              "race": "Download The Raceday Ready App Handicap",
              "race_id": "863467",
              "course": "Newcastle (AW)",
              "course_id": "crs_35178",
              "distance_f": "12.5",
              "distance_y": "2738",
              "quote": "Yakhabar is generally held up but everything else in the race was held up also, so I thought we'd take a chance and go forward and I think that's what's won him the race - Liam Bailey, trainer."
            }
          ],
