          "comment": "Good performances at Hamilton in last two attempts over 1m1f; not ruled out",
          "spotlight": "Form dipped over 1m2f on soft ground last time; progressive results otherwise this season, including twice over 1m1f at Hamilton, making all with something to spare the second time (penultimate outing); returned to this distance he remains of interest.",
