          "comment": "Won in good style at Ayr in April and has remained in good form since; respected",
          "spotlight": "Won in pretty good style at Ayr (7f, good) in April and has remained in good form since; kept on from off the pace for creditable fourth at York (7f, good to firm) on latest outing; respected.",
          "medical": [],
          "quotes": [
            {
              "date": "2023-07-25",
              "horse": "Yaaser",
              "horse_id": "3205693",
              "race": "Musselburgh Windsor FC Celebrating 70 Years Handicap",
              "race_id": "844134",
              "course": "Musselburgh",
              "course_id": "crs_416",
              "distance_f": "7",
              "distance_y": "1573",
              "quote": "The race didn't set up the way we thought as Joe (Fanning) got to the front and slowed up a bit but Yaaser did it well, he ran as straight as a gun-barrel up the straight. The last time here we probably played too early and we've learnt from that, the more you take him back the more he comes back on the bit. I think you could even play him later as he has a good turn of foot - Jim Goldie, trainer, speaking on Racing TV."
            }
          ],
          "stable_tour": [
            {
              "horse": "Yaaser",
              "horse_id": "3205693",
              "quote": "He looks to be back to his best and his best is very good. He had a good year last year but not quite where we'd had him before. He looked really well in the paddock before he won and showed his wellbeing in the race. He's won some nice races. He likes a strong pace to run at over 7f and I think that's possibly his optimum, but he ran well in the Carlisle Bell over a stiff mile. We've won it before but that race is on our bucket list, but it may be a bit sharp for him at the moment. We'll have a look at York for him because he ran well there last year and a big field over 7f would suit him. 07-05-25"
            }
          ],
