          "comment": "Dual chase winner in Ireland this spring; ran well over hurdles on recent stable debut",
          "spotlight": "Smart hurdler in his prime and a dual chase winner for Henry de Bromhead this spring (2m, yielding/good); held every chance before last-flight mishap in French hurdle race on recent stable debut and commands respect on this return to fences.",
          "medical": [],
          "quotes": [
            {
              "date": "2024-10-15",
              "horse": "Aspire Tower",
              "horse_id": "2137469",
              "race": "William Hill Committed To Top Prices Hurdle",
              "race_id": "879341",
              "course": "Punchestown",
              "course_id": "crs_5070",
              "distance_f": "18.5",
              "distance_y": "4054",
              "quote": "Aspire Tower obviously missed a bit of time and came back and it's great to see him go do that. He likes a nice gallop and he picked up from the bend when I got stuck into him. He jumped well and enjoyed himself. I was happy with the way he lengthened away coming to the last and he'll definitely come on for it - Darragh O'Keeffe, rider, speaking to Racing TV."
            },
            {
              "date": "2020-10-30",
              "horse": "Aspire Tower",
              "horse_id": "2137469",
              "race": "WKD Hurdle (Grade 2)",
              "race_id": "770275",
              "course": "Down Royal",
              "course_id": "crs_4680",
              "distance_f": "16.5",
              "distance_y": "3620",
              "quote": "He was so good at Christmas last year and I just felt after that his form just didn't look as good. He's a big four-year-old and he had only just come off the flat and maybe everything caught up with him a little bit as the season went on. Rachael [Blackmore] was brilliant on him, he is tough out and he did it the hard way on his first run since March. I'm delighted with Jason (The Militant) as well, he ran really well and Paul (Townend) thought he would come on from that - Henry de Bromhead, trainer of Aspire Tower"
            },
            {
              "date": "2020-03-13",
              "horse": "Aspire Tower",
              "horse_id": "2137469",
              "race": "JCB Triumph Hurdle (Grade 1)",
              "race_id": "747842",
              "course": "Cheltenham",
              "course_id": "crs_286",
              "distance_f": "17",
              "distance_y": "3699",
              "quote": "Aspire Tower was a bit free early on but it was his jumping that let him down. He still ran well, though - Rachael Blackmore, jockey"
            },
            {
              "date": "2019-12-26",
              "horse": "Aspire Tower",
              "horse_id": "2137469",
              "race": "Knight Frank Juvenile Hurdle (Grade 2)",
              "race_id": "747813",
              "course": "Leopardstown",
              "course_id": "crs_4862",
              "distance_f": "16",
              "distance_y": "3520",
              "quote": "I thought he did it really impressively. He went a really good gallop and jumped great. The Grade 1 back here in February is an obvious race to go for, but we'll talk to the owners and see what they want to do. He had the profile of one on the Flat that you would like to go hurdling with. I'd imagine good jumping ground would be alright for him as he's run on faster ground on the Flat - Henry de Bromhead, trainer of Aspire Tower"
            },
            {
              "date": "2019-11-26",
              "horse": "Aspire Tower",
              "horse_id": "2137469",
              "race": "Download The BETDAQ App 3-Y-O Maiden Hurdle",
              "race_id": "745883",
              "course": "Punchestown",
              "course_id": "crs_5070",
              "distance_f": "16.5",
              "distance_y": "3620",
              "quote": "Aspire Tower wasn't helped by the other horse but fair play to Rachael for getting him around. He ticked a lot of boxes coming to us and it's nice to see him go and do it. Leopardstown at Christmas is a race we'll definitely look at - Henry De Bromhead, trainer"
            },
            {
              "date": "2018-11-03",
              "horse": "Aspire Tower",
              "horse_id": "2137469",
              "race": "Tuckergardner Lettings Nursery Handicap",
              "race_id": "713308",
              "course": "Newmarket",
              "course_id": "crs_988",
              "distance_f": "9",
              "distance_y": "1980",
              "quote": "I rode Aspire Tower to be second on heavy ground at Goodwood so I knew he would handle this fine. The longer trip has suited him and he's a nice prospect for next year. - Harry Bentley, jockey"
            }
          ],
          "stable_tour": [
            {
              "horse": "Aspire Tower",
              "horse_id": "2137469",
              "quote": "We were delighted with him when he won over hurdles at Punchestown last month, which was his first win since 2020 as he had a long layoff and then did well without winning over fences last season. We probably got it wrong at Wincanton the other day as the ground was quick on a sharp track and at a sharp trip, so he never looked comfortable. He might mix it between hurdles and fences, maybe leaning more towards hurdling. There are plenty of options for him. 18-11-24"
            },
            {
              "horse": "Aspire Tower",
              "horse_id": "2137469",
              "quote": "He's another youngster who is progressing with each run. Last season he won a Grade 2 before finishing a fine second in the JCB Triumph Hurdle. This season he came out at Down Royal and won the Grade 2 WKD Hurdle from Abacadabras before putting up a career-best when second to Sharjah in the Grade 1 Matheson Hurdle over Christmas. Despite that great effort last time, he actually let himself down with poor jumps at the third-last and penultimate flights. However, as ever, he toughed it out up the straight. He's highly likely to go straight to Cheltenham now for the Champion Hurdle. 03-02-21"
            }
          ],
