          "comment": "Belated switch to fences as a 9yo but respected if taking to them, with conditions ideal",
          "spotlight": "Multiple Flat/hurdle winner, mainly in Jersey; in the frame over hurdles all four starts since winning on the Flat in April, most recently when staying on second at Fontwell (2m1f, good) last month; makes a belated switch to fences as a 9yo but respected if taking to them, with conditions ideal.",
