              "distance_y": "1100",
              "quote": "He did it well. He has run three times and has run well three times and I don't think ground matters to him. I'd imagine his owners would like to go to Royal Ascot and I'd imagine the Norfolk Stakes would be where he will be going, but he will probably have entries in some of the other two-year-old races that week - Paddy Twomey, trainer"
