          "comment": "Back to form for Limerick win (1m) in April but well held since; hard to be confident in",
          "spotlight": "Back to form for Limerick win (1m, soft) in April but well held since; hard to be confident in.",
          "medical": [],
          "quotes": [
            {
              "date": "2023-07-18",
              "horse": "Church Mountain",
              "horse_id": "3178683",
              "race": "William Hill Lengthen Your Odds Handicap",
              "race_id": "845573",
              "course": "Killarney",
              "course_id": "crs_4810",
              "distance_f": "8",
              "distance_y": "1790",
              "quote": "Church Mountain has taken a while to come around to our way of thinking but we got him started at Leopardstown a couple of weeks ago and ran a lovely race. It gave us confidence to drop him in because he's won his other races for Denis Hogan making it. He looked like he won snug enough at the line so hopefully he'll be able to go to Galway and be competitive - Michael O'Callaghan, trainer, talking to Racing TV."
            },
            {
              "date": "2022-06-11",
              "horse": "Church Mountain",
              "horse_id": "3178683",
              "race": "Limerick Racecourse Handicap",
              "race_id": "814659",
              "course": "Limerick",
              "course_id": "crs_4888",
              "distance_f": "8",
              "distance_y": "1760",
              "quote": "You'd call stall 18 a bad draw usually, but not with Church Mountain because he doesn't like traffic around him. If he's drawn low and misses the break, it can be hard for him to get going, but Dan is super value for his 7lb claim off those weights. This horse has won twice at Galway and hopefully will go back there. Even though he's a big horse, he seems to like good ground - Denis Hogan, trainer"
            },
            {
              "date": "2021-09-07",
              "horse": "Church Mountain",
              "horse_id": "3178683",
              "race": "James P. Cunningham Electrical Handicap",
              "race_id": "792968",
              "course": "Galway",
              "course_id": "crs_4758",
              "distance_f": "8.5",
              "distance_y": "1883",
              "quote": "Church Mountain picked up well and did everything for me today. I'd say he's going to make a lovely dual purpose horse, he won't be a horse until next year - Joey Sheridan, jockey."
            },
            {
              "date": "2021-08-01",
              "horse": "Church Mountain",
              "horse_id": "3178683",
              "race": "Kenny Galway Volvo Handicap",
              "race_id": "790364",
              "course": "Galway",
              "course_id": "crs_4758",
              "distance_f": "8.5",
              "distance_y": "1833",
              "quote": "Church Mountain is one we always liked, but he's a massive horse and still not the finished article. He was green in front but he needed to be there because he is a 1m2f horse. Making the running was the making of him - Denis Hogan, trainer."
            }
          ],
