          "comment": "Won here last year and high-class juvenile hurdle form since; likely big player",
          "spotlight": "Unbeaten in two Flat starts last year, including 1m2f conditions event here (beating Cheeky Wink 3l); high-class juvenile hurdler, winning Grade One at Leopardstown in February and good runs in defeat afterwards at same level at both Cheltenham and Punchestown; very interesting back on the Flat with likely more to offer; rain would suit.",
          "medical": [],
          "quotes": [
            {
              "date": "2025-02-01",
              "horse": "Hello Neighbour",
              "horse_id": "6327897",
              "race": "Gannon's City Recovery & Recycling Services Juvenile Hurdle (Grade 1)",
              "race_id": "885882",
              "course": "Leopardstown",
              "course_id": "crs_4862",
              "distance_f": "16",
              "distance_y": "3520",
              "quote": "Hello Neighbour is a proper one. We've brought him along along slowly. He's answered every call and hopefully he can improve again. We have always liked him. We put the hood on him and he was still a little bit keen but I think he'll learn every day - Gavin Cromwell, trainer"
            },
            {
              "date": "2024-12-26",
              "horse": "Hello Neighbour",
              "horse_id": "6327897",
              "race": "O'Driscolls Irish Whiskey Juvenile Hurdle (Grade 2)",
              "race_id": "884650",
              "course": "Leopardstown",
              "course_id": "crs_4862",
              "distance_f": "16",
              "distance_y": "3520",
              "quote": "That was great. It was a brave call to come here on his first start and thankfully Hello Neighbour hung on. He was keen in snatches in the race and because of that he didn't jump as well as he can do. I think when he learns to settle better in races he'll be better again. We'll look at the Dublin Racing Festival now - Gavin Cromwell, trainer."
            },
            {
              "date": "2024-10-14",
              "horse": "Hello Neighbour",
              "horse_id": "6327897",
              "race": "Roscommon Rated Race",
              "race_id": "879305",
              "course": "Roscommon",
              "course_id": "crs_5096",
              "distance_f": "10.5",
              "distance_y": "2295",
              "quote": "We're going to go hurdling with Hello Neighbour now and hopefully he's a good horse - Gavin Cromwell, trainer."
            },
            {
              "date": "2024-09-21",
              "horse": "Hello Neighbour",
              "horse_id": "6327897",
              "race": "Enjoy Hospitality At Navan Racecourse Maiden",
              "race_id": "877278",
              "course": "Navan",
              "course_id": "crs_5018",
              "distance_f": "14",
              "distance_y": "3080",
              "quote": "Hello Neighbour has a great mind and I was very surprised that he was keen early. He pulled for probably a mile or more and still finished. He did well as he probably got there plenty soon enough and then he idled - Gavin Cromwell, trainer."
            }
          ],
          "stable_tour": [
            {
              "horse": "Hello Neighbour",
              "horse_id": "6327897",
              "quote": "He's an interesting three-year-old we're excited about. He'll either go to the three-year-old maiden hurdle or the Grade 2. Often the maiden can be as good as the Grade 2. He's never run over hurdles but he's two from two for us on the Flat. He's one we are looking forward to. 21-12-24"
            },
            {
              "horse": "Hello Neighbour",
              "horse_id": "6327897",
              "quote": "He's a lovely horse who ran to a good level when winning his two starts on the Flat for us at Navan and Roscommon. We gave him a three-week break after his win at Roscommon and he's just started back now with a view to Leopardstown at Christmas. He has a nice pedigree, jumps well and we like him. 13-11-24"
            }
          ],
