          "comment": "Best handicap form at 1m2f; needs to improve for this step up in trip",
          "spotlight": "All three handicap wins have been at 1m2f, including latest in Curragh premier event in late May; safely held previously in Gowran Listed so needs to step forward on return to that level on only second attempt at this trip.",
          "medical": [],
          "quotes": [
            {
              "date": "2025-05-24",
              "horse": "Apercu",
              "horse_id": "5396360",
              "race": "Tulfarris Hotel And Golf Resort Handicap (Premier Handicap)",
              "race_id": "896062",
              "course": "Curragh",
              "course_id": "crs_4628",
              "distance_f": "10",
              "distance_y": "2200",
              "quote": "Apercu is a tough mare, she's improving and Billy knows her well. He gave her a great ride. She seems to go everywhere he wants her. She got it handy up front and he said himself that he probably got there a bit earlier than he thought. She was enjoying herself and was going sweetly. She battles and when the horse came back at her she just kept finding. She was tough out, she's a great filly to watch because she wears her heart on his sleeve. Barry Irwin, CEO of Team Valor, has been a great supporter of mine over the years. We have a few together as well at the moment. It's an exciting venture. This filly has done nothing but improve. She's been very easy to train and has given everybody a lot of fun - Andy Oliver, trainer."
            }
          ],
          "stable_tour": [
            {
              "horse": "Apercu",
              "horse_id": "5396360",
              "quote": "She will probably go for the Northfields Handicap. She won nicely at Naas and she stepped up to a mile and half at the Curragh and finished sixth, which I was a bit disappointed with as I thought she had a great chance. I'm not quite sure she got the trip, so we're bringing her back in distance. She'll be near the bottom of the handicap but she has a fair chance of getting in. 11-09-24"
            }
          ],
