          "prev_trainers": [],
          "prev_owners": [],
          "comment": "Last year's Irish Oaks third not a strong stayer at this trip but remains the one to beat",
          "spotlight": "Smart filly finished third in last year's Irish Oaks and later in season recorded similar RPR when close third in Group 2 Blandford at the Curragh; not the strongest finisher but the one to beat on seasonal return.",
          "medical": [],
          "quotes": [
            {
              "date": "2024-07-20",
              "horse": "Purple Lily",
              "horse_id": "5203866",
              "race": "Juddmonte Irish Oaks (Group 1) (Fillies)",
              "race_id": "853875",
              "course": "Curragh",
              "course_id": "crs_4628",
              "distance_f": "12",
              "distance_y": "2640",
              "quote": "The ground is probably quick enough for Purple Lily. Back over a mile and a quarter on softer ground could see her in a better light again. She's a filly that's only really starting off. She has come forward from the Guineas and we are delighted with her - Paddy Twomey, trainer."
            },
            {
              "date": "2024-03-24",
              "horse": "Purple Lily",
              "horse_id": "5203866",
              "race": "TRM Equine Nutrition Race",
              "race_id": "863879",
              "course": "Naas",
              "course_id": "crs_4992",
              "distance_f": "8",
              "distance_y": "1760",
              "quote": "Purple Lily is a nice filly and she wintered well. She has size and scope and I'm very happy with the way it went. When you are taking on a 108-rated colt you are asking them a question and she did it well. We might look at a Guineas trial and then the Irish Guineas. Newmarket might come a bit quick and I think we'll take our time - Paddy Twomey, trainer."
            },
            {
              "date": "2023-08-01",
              "horse": "Purple Lily",
              "horse_id": "5203866",
              "race": "COLM QUINN BMW Irish EBF Fillies Maiden (IRE Incentive Race)",
              "race_id": "846449",
              "course": "Galway",
              "course_id": "crs_4758",
              "distance_f": "7",
              "distance_y": "1549",
              "quote": "When the gates opened, I was thinking for the first half-furlong that this mightn't go as planned for Purple Lily but she picked it up after half a furlong and travelled. Billy (Lee) was great on her and she answered his call. Since she came from the sales, she fitted into the system well and had been working well over the last few weeks. She handled the track which is hard first time out and quickened fairly readily in the straight. She had shown us that once or twice at home and I think she's a nice filly - Paddy Twomey, trainer."
            }
          ],
