          "comment": "Dual-purpose sort remains best watched on second start off a huge lay-off",
          "spotlight": "Dual-purpose sort had run well in defeat in some novice chases some years ago but remains best watched on second start off a huge lay-off.",
          "medical": [],
          "quotes": [
            {
              "date": "2021-09-18",
              "horse": "Turnpike Trip",
              "horse_id": "1309608",
              "race": "Close Brothers Cesarewitch Trial Handicap",
              "race_id": "791743",
              "course": "Newmarket",
              "course_id": "crs_988",
              "distance_f": "18",
              "distance_y": "3960",
              "quote": "Turnpike Trip did that nicely and only had 8st 2lb so was getting plenty of weight off the second - John Egan, jockey."
            },
            {
              "date": "2019-10-06",
              "horse": "Turnpike Trip",
              "horse_id": "1309608",
              "race": "Joe Mac Novice Hurdle (Grade 3)",
              "race_id": "741599",
              "course": "Tipperary",
              "course_id": "crs_5252",
              "distance_f": "16",
              "distance_y": "3520",
              "quote": "He slipped in the ground and did well to win and was going away again at the line. It was a good performance and he would have won well, by four or five lengths, only for the mistake - Charles Byrnes, trainer"
            },
            {
              "date": "2019-09-14",
              "horse": "Turnpike Trip",
              "horse_id": "1309608",
              "race": "Gas Networks Ireland Novice Hurdle",
              "race_id": "739784",
              "course": "Listowel",
              "course_id": "crs_4940",
              "distance_f": "16",
              "distance_y": "3520",
              "quote": "We got one at last! His experience won the day, he's deadly to jump and was definitely a lot slicker than the favourite. He had a very good run at Galway last time when I thought the ground might have been on the fast side for him, it's lovely jumping ground here. I'd say he'll step up in grade, I don't think we'll try him back on the Flat at this stage of the season - Charles Byrnes, trainer of Turnpike Trip"
            },
            {
              "date": "2019-07-12",
              "horse": "Turnpike Trip",
              "horse_id": "1309608",
              "race": "mallowprint.ie Maiden Hurdle",
              "race_id": "735363",
              "course": "Cork",
              "course_id": "crs_15496",
              "distance_f": "16",
              "distance_y": "3520",
              "quote": "Turnpike Trip was ready a while ago but he kept getting small setbacks. He'll probably mix it with Flat and jumping for the rest of the summer - Charles Byrnes, trainer"
            },
            {
              "date": "2017-09-06",
              "horse": "Turnpike Trip",
              "horse_id": "1309608",
              "race": "Ambant Fine Art And Specie Handicap",
              "race_id": "682483",
              "course": "Lingfield",
              "course_id": "crs_806",
              "distance_f": "10",
              "distance_y": "2200",
              "quote": "Turnpike Trip is improving but is still a bit of a baby. He's got a lot of growing up to do and the track didn't really suit - he didn't corner all that well - but he got the job done. He likes his racing and will get 1m4f in time - Henry Candy, trainer"
            }
          ],
