          "comment": "Has dropped plenty in the handicap and two solid efforts in March; has a shout",
          "spotlight": "Won the valuable 2m1f handicap chase at the Dublin Racing Festival in 2021-22; hasn't scored since but has dropped plenty in the handicap and two solid efforts in March; has a shout.",
          "medical": [],
          "quotes": [
            {
              "date": "2022-02-05",
              "horse": "A Wave Of The Sea",
              "horse_id": "2651857",
              "race": "Paddy Power \"I'm Never Going Back To The Office\" Handicap Chase (Grade B)",
              "race_id": "803597",
              "course": "Leopardstown",
              "course_id": "crs_4862",
              "distance_f": "17",
              "distance_y": "3783",
              "quote": "A Wave Of The Sea jumped savage today, we put the blinkers on, Shane gave him a great ride. I am delighted to get a winner here this weekend. He is not especially well-handicapped but he is a good tough horse who turns up and runs his race. We'll speak to JP (McManus) and Frank (Berry) but he might be one that could win a good pot at home while others are gone over to Cheltenham. We'll see what they want to do - Joseph O'Brien, trainer."
            },
            {
              "date": "2021-02-06",
              "horse": "A Wave Of The Sea",
              "horse_id": "2651857",
              "race": "Matheson Handicap Chase (Grade B)",
              "race_id": "777100",
              "course": "Leopardstown",
              "course_id": "crs_4862",
              "distance_f": "17.5",
              "distance_y": "3797",
              "quote": "A Wave Of The Sea struggled a bit in graded company, last day was a bit better and he jumped very well today. It was probably the difference. He could easily travel to Cheltenham for one of the handicap chases - Joseph O'Brien, trainer."
            },
            {
              "date": "2019-11-02",
              "horse": "A Wave Of The Sea",
              "horse_id": "2651857",
              "race": "Value Cabs 3-Y-O Hurdle",
              "race_id": "743981",
              "course": "Down Royal",
              "course_id": "crs_4680",
              "distance_f": "16.5",
              "distance_y": "3620",
              "quote": "A Wave Of The Sea is not a natural front-runner and he probably needed a lead for a bit further. We've always thought a fair bit of him and he'll be better as a four and five-year-old. He's still big and weak, but he travelled lovely today and jumped great up to the second last - Brendan Powell, assistant trainer"
            },
            {
              "date": "2019-10-15",
              "horse": "A Wave Of The Sea",
              "horse_id": "2651857",
              "race": "Ladbrokes 3-Y-O Hurdle",
              "race_id": "742475",
              "course": "Punchestown",
              "course_id": "crs_5070",
              "distance_f": "16",
              "distance_y": "3540",
              "quote": "A Wave Of The Sea was green in front and he just outstayed the other lad in the end. He's a nice horse and a stronger run race when he can get a lead will suit him better - Brendan Powell, assistant trainer."
            }
          ],
          "stable_tour": [
            {
              "horse": "A Wave Of The Sea",
              "horse_id": "2651857",
              "quote": "He's won three races at the Dublin Racing Festival, the first as a juvenile hurdler, so I guess that's the way we'll be heading with him, to try to win the Grade B handicap chase there for a third time. He's a good, solid handicapper and only six. There have been a few times when he's been let down by his jumping, but at the same time there have been days when he has jumped really well and everything has gone right. So far the pattern has been one big win every season, so I'm hopeful he can do that again at least. 20-10-22"
            },
            {
              "horse": "A Wave Of The Sea",
              "horse_id": "2651857",
              "quote": "A consistent performer who always runs his race. In each of the last two seasons he has landed a valuable pot at the Dublin Racing Festival and he came up just short this term in his bid for the hat-trick when third to a well-handicapped horse. He's an intended runner in the Grand National this weekend and, although he has never faced the Aintree fences before, I think he will be fine, but there is only one way to find out. 12-04-23"
            }
          ],
