          "comment": "Beaten 20l last time and is 12lb out of the handicap",
          "spotlight": "Veteran was beaten 20l last time and is 12lb out of the handicap so isn't easy to fancy.",
          "medical": [],
          "quotes": [
            {
              "date": "2024-06-15",
              "horse": "Robin De Roost",
              "horse_id": "879679",
              "race": "Download The New Tote App Handicap Chase",
              "race_id": "870817",
              "course": "Downpatrick",
              "course_id": "crs_4654",
              "distance_f": "19.5",
              "distance_y": "4280",
              "quote": "This is just amazing. I rode Robin De Roost last year but the ground was never right - he needs good, good to firm.  They didn't go overly quick, which suited him, as he needs to be up there or he loses interest. Thomas [Gibney, trainer] had him spot on - Aileen O'Sullivan, rider, speaking to Racing TV."
            },
            {
              "date": "2017-07-07",
              "horse": "Robin De Roost",
              "horse_id": "879679",
              "race": "Michael Moore Mercedes-Benz & Volkswagen, Portarlington & Athlone Handicap Chase",
              "race_id": "680384",
              "course": "Wexford",
              "course_id": "crs_5226",
              "distance_f": "20",
              "distance_y": "4400",
              "quote": "He battled really well, which he showed last time too, and we weren't sure about his battling qualities before that. He was under pressure a long way out and I wasn't too confident coming down to the last bend. We'll keep tipping away and look for something similar again. I'd say he'll get further than that again - Tom Gibney, trainer"
            },
            {
              "date": "2017-05-31",
              "horse": "Robin De Roost",
              "horse_id": "879679",
              "race": "Download And Bet With The Ladbrokes App Handicap Chase",
              "race_id": "677186",
              "course": "Punchestown",
              "course_id": "crs_5070",
              "distance_f": "20",
              "distance_y": "4400",
              "quote": "Robin De Roost gave me a nice feel for a long way at Fairyhouse and I managed to get him out in front here, and he jumped and travelled beautifully. The stable is in much better form now and it makes the world of difference - Jonathan Moore, jockey."
            }
          ],
