          "comment": "Bumper and hurdles winner, went close on second chase start latest, chance up in trip",
          "spotlight": "One of two for yard; bumper and hurdles winner on yielding and soft to heavy; much improved on second chase start when going close in a beginners' at Tramore (15.5f, gd-yld) in late May; this longer trip worth a go on the evidence of that run; chance.",
