              "race_id": "896790",
              "course": "Listowel",
              "course_id": "crs_4940",
              "distance_f": "16.5",
              "distance_y": "3620",
              "quote": "We knew Royal Eagle stayed further, she was second in a Listed race at Limerick over 3m so my plan was always to bounce out and make it a good test. While we weren't hanging around I don't think we were going too quick either and maybe she wants more of a trip, but she has won on the Flat as well so she is so versatile - Josh Williamson, jockey."
